import React from "react";
import "./Requestaccess.css";

function Requestaccess() {
  const [username, setUserName] = useState("");
  const [gmail, setGmail] = useState("");
  const [password, setPassword]=useState("");
  const [role, setRole] = useState("");
  const [contactnumber,setContactNumber]=useState("");
  const [libid, setLibId]=useState("");
  const [message, setMessage] = useState("");

  let handleSubmit = async (e) => {
    e.preventDefault();
    try {
      let res = await fetch("http://localhost:8080/userrequest", {
        method: "POST",
        body: JSON.stringify({
          username: username,
          gmail: gmail,
          password: password,
          role: role,
          contactnumber: Number(contactnumber),
          libid: Number(libid),
        }),
      });
      console.log(res)
      let resJson = await res.json();
      if (res.status === 200) {
        setUserName("");
        setGmail("");
        setPassword("");
        setRole("");
        setContactNumber("");
        setLibId("");
        setMessage("User created successfully");
      } else {
        setMessage("Some error occured");
      }
    } catch (err) {
      console.log(err);
    }
  };
  return (
    <div className="about">
      <div className="login1">
      <h4>Access Request</h4>
      <form onSubmit={handleSubmit}>
      <div   className="text_area">
      <label htmlFor="gmail">User Name:</label>
      <input
        type="text"
        value={username}
        // placeholder="LibName"
        onChange={(e) => setUserName(e.target.value)}
        className="text_input"
      />
      </div>

     <div className="text_area" >
     <label htmlFor="gmail">User Gmail:</label>
     <input
        type="email"
        value={gmail}
        onChange={(e) => setGmail(e.target.value)}
        // defaultValue="Email@example.com"
        className="text_input"
      />
     </div>

     <div className="text_area" >
     <label htmlFor="contactNumber">Contact Number:</label>
     <input
        type="tel"
        id="contactNumber"
        name="contactNumber"
        pattern="[0-9]{10}"
        // defaultValue="Email@example.com"
        className="text_input"
      />
     </div>



     <div className="text_area" >
     <label htmlFor="libId">Select Library ID:</label>
     <input
        type="number"
        id="libId"
        name="libId"
        // defaultValue="Email@example.com"
        className="text_input"
      />
     </div>

     <div className="text_area" >
     <label htmlFor="password">Password:</label>
     <input
        type="password"
        id="password"
        name="password"
        className="text_input"
      />
     </div>
     <div className="text_area inline" >
     <label className="gap" htmlFor="role" aline="left">Role:</label>

        <input
          type="radio"
          id="admin"
          name="role"
          value="admin"

        />
        <label htmlFor="admin">Admin</label>

        <input
          type="radio"
          id="reader"
          name="role"
          value="reader"

        />
        <label htmlFor="reader">Reader</label>
     </div>

      <input
          type="submit"
          value="Request"
          className="btn"

        />
    </form>
      </div>
    </div>
  );
}
export default Requestaccess;
